➡️ @INGuardsman is being deployed to six food banks to help sort & pack food for distribution to pantries.

The food banks are in Marion County (2), Bloomington, Lafayette, Fort Wayne & Merrillville.

@INGuardsman will work at mobile food distribution sites across the state.

Today, I also announced further steps we’re taking to protect Hoosiers’ health & slow the spread of #COVID19.

